package com.vk2.touchsreentab.model;import com.google.gson.annotations.SerializedName;public class SoundCloudObject {    @SerializedName("id")    private int id;    @SerializedName("title")    private String title;    @SerializedName("stream_url")    private String stream_url;    @SerializedName("artwork_url")    private String artwork_url;    @SerializedName("description")    private String description;    public SoundCloudObject() {    }    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String getStream_url() {        return stream_url;    }    public void setStream_url(String stream_url) {        this.stream_url = stream_url;    }    public String getArtwork_url() {        return artwork_url;    }    public void setArtwork_url(String artwork_url) {        this.artwork_url = artwork_url;    }    public String getDescription() {        return description;    }    public void setDescription(String description) {        this.description = description;    }}